INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", -285.0, 1020101, 5.18, 7, 10201, "2030/01/01 14:59:59", 3, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 133701, -6.0, 61, 101, "ラビリスタ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", -285.0, 1020102, 8.77, 2, 10201, "2030/01/01 14:59:59", 1, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 133901, -2.0, 61, 201, "クリスティーナ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/01/31 12:00:00", -285.0, 1020103, 15.5, 1, 10201, "2030/01/01 14:59:59", 6, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 133801, 0.0, 61, 301, "ネネカ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/02/28 12:00:00", -285.0, 1020201, 9.061, 5, 10202, "2030/01/01 14:59:59", 2, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 134301, 0.0, 61, 101, "ランファ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/02/28 12:00:00", -285.0, 1020202, 7.699, 2, 10202, "2030/01/01 14:59:59", 1, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 134401, 0.0, 61, 201, "チカ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/03/31 12:00:00", -285.0, 1020301, 8.595, 2, 10203, "2030/01/01 14:59:59", 1, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 134601, 0.0, 61, 101, "アオイ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/03/31 12:00:00", -285.0, 1020302, 7.758, 2, 10203, "2030/01/01 14:59:59", 1, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 134501, 0.0, 61, 201, "クローチェ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/04/30 12:00:00", -285.0, 1020401, 7.0, 6, 10204, "2030/01/01 14:59:59", 2, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 132302, 0.0, 61, 101, "ルイズマリー");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/04/30 12:00:00", -285.0, 1020402, 7.904, 2, 10204, "2030/01/01 14:59:59", 1, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 132402, 0.0, 61, 201, "イロハ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/04/30 12:00:00", -285.0, 1020403, 8.487, 2, 10204, "2030/01/01 14:59:59", 4, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 132502, 0.0, 61, 301, "ソノ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/05/31 12:00:00", -285.0, 1020502, 8.763, 2, 10205, "2030/01/01 14:59:59", 1, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 134901, 0.0, 61, 101, "カノン");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/05/31 12:00:00", -285.0, 1020503, 6.417, 3, 10205, "2030/01/01 14:59:59", 1, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 134801, 0.0, 61, 201, "ツムギ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/06/30 12:00:00", -285.0, 1020601, 10.335, 7, 10206, "2030/01/01 14:59:59", 3, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 135001, 0.0, 61, 101, "エリス");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/06/30 12:00:00", -285.0, 1020602, 6.281, 4, 10206, "2030/01/01 14:59:59", 2, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 135101, 0.0, 61, 201, "シェフィ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/06/30 12:00:00", -285.0, 1020603, 12.244, 2, 10206, "2030/01/01 14:59:59", 1, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 135201, 0.0, 61, 301, "プレシア");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/07/31 12:00:00", -285.0, 1020701, 6.339, 8, 10207, "2030/01/01 14:59:59", 2, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 135301, 0.0, 61, 101, "クリア");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/07/31 12:00:00", -285.0, 1020702, 8.184, 9, 10207, "2030/01/01 14:59:59", 7, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 135401, 0.0, 61, 201, "アネモネ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", -285.0, 1020801, 3.906, 2, 10208, "2030/01/01 14:59:59", 9, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 129101, 0.0, 61, 101, "アイラ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", -285.0, 1020802, 14.465, 2, 10208, "2030/01/01 14:59:59", 1, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 129201, 0.0, 61, 201, "シナツ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", -285.0, 1020803, 8.662, 3, 10208, "2030/01/01 14:59:59", 4, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 100101, 0.0, 61, 301, "ヒヨリ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/08/31 12:00:00", -285.0, 1020804, 10.915, 3, 10208, "2030/01/01 14:59:59", 1, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 100301, 0.0, 61, 401, "レイ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/09/30 12:00:00", -285.0, 1020901, 6.042, 7, 10209, "2030/01/01 14:59:59", 1, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 135802, 0.0, 61, 101, "ユキノ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/09/30 12:00:00", -285.0, 1020902, 9.402, 1, 10209, "2030/01/01 14:59:59", 4, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 135903, 0.0, 61, 201, "サツキ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/09/30 12:00:00", -285.0, 1020903, 8.16, 1, 10209, "2030/01/01 14:59:59", 8, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 136902, 0.0, 61, 301, "ルルィ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/10/31 12:00:00", -285.0, 1021001, 5.0, 2, 10210, "2030/01/01 14:59:59", 3, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 137401, 0.0, 61, 101, "カスミ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/10/31 12:00:00", -285.0, 1021002, 8.12, 1, 10210, "2030/01/01 14:59:59", 4, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 136001, 0.0, 61, 201, "アラクネ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/10/31 12:00:00", -285.0, 1021003, 6.386, 2, 10210, "2030/01/01 14:59:59", 4, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 136202, 0.0, 61, 301, "ナーナ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/11/30 12:00:00", -285.0, 1021101, 7.438, 4, 10211, "2030/01/01 14:59:59", 3, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 136402, 0.0, 61, 101, "ユイ");
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("2025/11/30 12:00:00", -285.0, 1021102, 8.35, 5, 10211, "2030/01/01 14:59:59", 1, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 136302, 0.0, 61, 201, "ミソラ");
